import logo from './logo.svg';
import './App.css';

import rina from './rina.png';
import Header from './header'

function App() {
  return (
    <div className="App h-auto w-auto flex-row bg-white top-bg bg-cover bg-no-repeat sm:bg-center ">
      <Header></Header>
      <div className="top flex h-1auto items-center shadow-md border-2 border-black">
        <div className="top-left w-1/2 px-10" >
          <p className='text-7xl font-SairaReg text-black  font-semibold'>Welcome To <br /> Tensai</p>
        </div>
        <div className="top-right w-1/2 h-1/2">
          <img src={rina} alt="" srcset=""/>
        </div>
      </div>
      <div className="middle flex bg-white py-28 h-full">
        <div className="flex-row w-screen h-auto">
          <p className='text-4xl font-SairaReg'>What is TENSAI?</p>
          <p className='px-20 py-10 font-semibold text-center font-SairaReg text-lg'>TENSAI is an Interactive E-learning Progressive Web Application 
          in Science for Grade 1 Students with Voice Controlled Assistant</p>
          <p className='px-20 text-justify'>The main objective of the study is to develop TENSAI: An Interactive E-Learning Progressive Web Application in 
            Science for Grade 1 Students with Voice Controlled Assistant that will increase the interest of the students to 
            study the Science subject in a suitable learning environment.</p>
        </div>
      </div>

    </div>
  );
}

export default App;
